  <body>
  ​
  <div>div,
    <span>span, </span>
    <b>b </b>
  </div>
  ​
  <p>p,
    <span>span,
    <em>em </em>
    </span>
  </p>
  ​
  <div>div,
    <strong>strong,
    <span>span, </span>
    <em>em,
    <b>b, </b>
    </em>
    </strong>
    <b>b </b>
  </div>
  ​
  <script>
  $( "*", document.body ).each(function() {
    var parentTag = $( this ).parent().get( 0 ).tagName;
    $( this ).prepend( document.createTextNode( parentTag + " > " ) );
  });
  </script>
